import React, { useState } from "react";
import "./SearchPage.css";

function SearchPage() {
  const [formData, setFormData] = useState({
    sourceAirportCode: "",
    destinationAirportCode: "",
    date: "",
    returnDate: "",
    itineraryType: "",
    sortOrder: "",
    numAdults: "",
    numSeniors: "",
    classOfService: "",
  });

  const [flights, setFlights] = useState([]);
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    fetch("http://localhost:3002/searchFlights", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.error) {
          setError(data.error);
          setFlights([]);
        } else {
          setFlights(data);
          setError(null);
        }
      })
      .catch((error) => {
        setError("Error searching flights");
        setFlights([]);
      });
  };

  return (
    <div className="search-page">
      <h2>If you are here you successfully "logged in."</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="sourceAirportCode"
          placeholder="Source Airport Code"
          value={formData.sourceAirportCode}
          onChange={handleChange}
        />
        <input
          type="text"
          name="destinationAirportCode"
          placeholder="Destination Airport Code"
          value={formData.destinationAirportCode}
          onChange={handleChange}
        />
        <input
          type="date"
          name="date"
          placeholder="Date"
          value={formData.date}
          onChange={handleChange}
        />
        <input
          type="date"
          name="returnDate"
          placeholder="Return Date"
          value={formData.returnDate}
          onChange={handleChange}
        />
        <input
          type="text"
          name="itineraryType"
          placeholder="Itinerary Type"
          value={formData.itineraryType}
          onChange={handleChange}
        />
        <input
          type="text"
          name="sortOrder"
          placeholder="Sort Order"
          value={formData.sortOrder}
          onChange={handleChange}
        />
        <input
          type="text"
          name="numAdults"
          placeholder="Number of Adults"
          value={formData.numAdults}
          onChange={handleChange}
        />
        <input
          type="text"
          name="numSeniors"
          placeholder="Number of Seniors"
          value={formData.numSeniors}
          onChange={handleChange}
        />
        <input
          type="text"
          name="classOfService"
          placeholder="Class of Service"
          value={formData.classOfService}
          onChange={handleChange}
        />
        <button type="submit">Search Flights</button>
      </form>
      {error && <div className="error">{error}</div>}
      <ul>
        {flights.map((link, index) => (
          <li key={index}>
            <div>Provider: {link.providerId}</div>
            <div>Price: {link.totalPrice}</div>
            <div>
              <a href={link.url} target="_blank" rel="noopener noreferrer">
                Book now
              </a>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default SearchPage;
